jssearch.files = {"1":{"u":".\/\/assets\/a44c75fa\/example.html","t":"Example","d":""},"2":{"u":".\/\/assets\/a44c75fa\/tests\/data\/other.html","t":"A completely different headline","d":"Lorem lorem lorem ipsum dolor sit amet, consetetur sadipscing elitr."},"3":{"u":".\/\/assets\/a44c75fa\/tests\/data\/simple.html","t":"This is an Example Page","d":"Lorem ipsum dolor sit amet, consetetur sadipscing elitr."},"4":{"u":".\/\/guide-en-active-record.html","t":"Active Record ","d":"Active Record implements the Active Record design pattern.\nThe premise behind Active Record is that an individual ActiveRecord object is associated with a specific row in a database table. The object's attributes are mapped to the columns of the corresponding table. Referencing an Active Record attribute is equivalent to accessing\nthe corresponding table column for that record."},"5":{"u":".\/\/guide-en-apps-advanced.html","t":"Advanced application template ","d":"This template is for large projects developed in teams where backend is divided from frontend, application is deployed\nto multiple servers etc. This application template also goes a bit further regarding features and provides essential\ndatabase, signup and password restore out of the box."},"6":{"u":".\/\/guide-en-apps-basic.html","t":"Basic application template ","d":"This template is a perfect fit for small projects or learning Yii2."},"7":{"u":".\/\/guide-en-apps-own.html","t":"Creating your own Application structure ","d":"TDB"},"8":{"u":".\/\/guide-en-assets.html","t":"Managing assets ","d":"An asset in Yii is a file that is included into the page. It could be CSS, JavaScript or\nany other file. Framework provides many ways to work with assets from basics such as adding &lt;script src=\" tag\nfor a file that is handled by View section to advanced usage such as pusblishing files that are not\nunder webserve document root, resolving JavaScript dependencies or minifying CSS."},"9":{"u":".\/\/guide-en-authentication.html","t":"Authentication ","d":"Authentication is the act of verifying who a user is, and is the basis of the login process. Typically, authentication uses an identifier--a username or email address--and password, submitted through a form. The application then compares this information against that previously stored."},"10":{"u":".\/\/guide-en-authorization.html","t":"Authorization ","d":"Authorization is the process of verifying that user has enough permissions to do something. Yii provides several methods\nof controlling it."},"11":{"u":".\/\/guide-en-basics.html","t":"Basic concepts of Yii ","d":"Classes of the Yii framework usually extend from one of the two base classes Object and Component.\nThese classes provide useful features that are added automatically to all classes extending from them."},"12":{"u":".\/\/guide-en-behaviors.html","t":"Behaviors ","d":"A behavior (also knows as mixin) can be used to enhance the functionality of an existing component without modifying its\ncode. In particular, it can \"inject\" its own methods and properties into the component and make them directly accessible\nvia the component. It can also respond to the events triggered in the component and thus intercept the normal\ncode execution. Unlike PHP traits, behaviors could be attached to classes at runtime."},"13":{"u":".\/\/guide-en-bootstrap-widgets.html","t":"Bootstrap widgets ","d":"Out of the box, Yii includes support for the Bootstrap 3 markup and components framework (also known as \"Twitter Bootstrap\"). Bootstrap is an excellent, responsive framework that can greatly speed up the client-side of your development process."},"14":{"u":".\/\/guide-en-caching.html","t":"Caching ","d":"Caching is a cheap and effective way to improve the performance of a web application. By storing relatively\nstatic data in cache and serving it from cache when requested, we save the time needed to generate the data."},"15":{"u":".\/\/guide-en-composer.html","t":"Composer ","d":"Yii2 uses Composer as its package manager. Composer is a PHP utility that can automatically handle the installation of needed libraries and\nextensions, thereby keeping those third-party resources up to date while absolving you of the need to manually manage the project's dependencies."},"16":{"u":".\/\/guide-en-configuration.html","t":"Configuration ","d":"Yii applications rely upon components to perform most of the common tasks, such as connecting to a database, routing browser\nrequests, and handling sessions. How these stock components behave can be adjusted by configuring your Yii application.\nThe majority of components have sensible defaults, so it's unlikely that you'll spend a lot of time configuring\nthem. Still there are some mandatory settings, such as the database connection, that you will have to establish."},"17":{"u":".\/\/guide-en-console.html","t":"Console applications ","d":"Yii has full featured support of console. Console application structure in Yii is very similar to web application. It\nconsists of one or more \\yii\\console\\Controller (often referred to as commands). Each has one or more actions."},"18":{"u":".\/\/guide-en-controller.html","t":"Controller ","d":"Controller is one of the key parts of the application. It determines how to handle incoming request and creates a response."},"19":{"u":".\/\/guide-en-database-basics.html","t":"Database basics ","d":"Yii has a database access layer built on top of PHP's PDO. It provides\nuniform API and solves some inconsistencies between different DBMS. By default Yii supports the following DBMS:"},"20":{"u":".\/\/guide-en-debugger.html","t":"Debug toolbar and debugger ","d":"Yii2 includes a handy toolbar to aid faster development and debugging as well as debugger. Toolbar displays information\nabout currently opened page while using debugger you can analyze data collected before."},"21":{"u":".\/\/guide-en-error.html","t":"Error Handling ","d":"Error handling in Yii is different from plain PHP. First of all, all non-fatal errors are converted to exceptions so\nyou can use try-catch to work with these. Second, even fatal errors are rendered in a nice way. In debug mode that\nmeans you have a trace and a piece of code where it happened so it takes less time to analyze and fix it."},"22":{"u":".\/\/guide-en-events.html","t":"Events ","d":"TBD, see also Component.md."},"23":{"u":".\/\/guide-en-extensions.html","t":"Extending Yii ","d":"TDB"},"24":{"u":".\/\/guide-en-form.html","t":"Working with forms ","d":"The primary way of using forms in Yii is through yii\\widgets\\ActiveForm. This approach should be preferred when the form is based upon  a model. Additionally, there are some useful methods in \\yii\\helpers\\Html that are typically used for adding buttons and help text to any form."},"25":{"u":".\/\/guide-en-gii.html","t":"The Gii code generation tool ","d":"Yii2 includes a handy tool that allows rapid prototyping by generating commonly used code snippets\nas well as complete CRUD controllers."},"26":{"u":".\/\/guide-en-i18n.html","t":"Internationalization ","d":"Internationalization (I18N) refers to the process of designing a software application so that it can be adapted to\nvarious languages and regions without engineering changes. For Web applications, this is of particular importance\nbecause the potential users may be worldwide."},"27":{"u":".\/\/guide-en-index.html","t":"Introduction ","d":"Configuration - Configuration of a Yii application"},"28":{"u":".\/\/guide-en-installation.html","t":"Installation ","d":"There are two ways you can install the Yii framework:"},"29":{"u":".\/\/guide-en-logging.html","t":"Logging ","d":"TDB"},"30":{"u":".\/\/guide-en-migration.html","t":"Database Migration ","d":"Like source code, the structure of a database is evolving as we develop and maintain\na database-driven application. For example, during development, we may want to\nadd a new table; or after the application is put into production, we may realize\nthe need of adding an index on a column. It is important to keep track of these\nstructural database changes (called migration) like we do with our source\ncode. If the source code and the database are out of sync, it is very likely\nthe whole system may break. For this reason, Yii provides a database migration\ntool that can keep track of database migration history, apply new migrations,\nor revert existing ones."},"31":{"u":".\/\/guide-en-model.html","t":"Model ","d":"In keeping with the MVC approach, a model in Yii is intended for storing or temporarily representing application data. Yii models have the following basic features:"},"32":{"u":".\/\/guide-en-mvc.html","t":"MVC Overview ","d":"Yii implements the model-view-controller (MVC) design pattern, which is\nwidely adopted in web and other application programming. MVC aims to separate business logic from\nuser interface considerations, allowing developers to more easily change individual components of an application without affecting, or even touching, another."},"33":{"u":".\/\/guide-en-overview.html","t":"What is Yii ","d":"Yii is a high-performance, component-based PHP framework for rapidly developing large-scale Web applications. Yii enables maximum reusability in Web\nprogramming and can significantly accelerate your Web application development\nprocess. The name Yii (pronounced Yee or [ji:]) is an acronym for\nYes It Is!."},"34":{"u":".\/\/guide-en-performance.html","t":"Performance Tuning ","d":"The performance of your web application is based upon two parts. First is the framework performance\nand the second is the application itself. Yii has a pretty low performance impact\non your application out of the box and can be fine-tuned further for production\nenvironment. As for the application, we'll provide some of the best practices\nalong with examples on how to apply them to Yii."},"35":{"u":".\/\/guide-en-query-builder.html","t":"Query Builder and Query ","d":"Yii provides a basic database access layer as was described in Database basics section. Still it's\na bit too much to use SQL directly all the time. To solve the issue Yii provides a query builder that allows you to\nwork with the database in object-oriented style."},"36":{"u":".\/\/guide-en-security.html","t":"Security ","d":"Good security is vital to the health and success of many websites. Unfortunately, many developers may cut corners when it comes to security due to a lack of understanding or too large of an implementation hurdle. To make your Yii-based site as secure as possible, the Yii framework has baked in several excellent, and easy to use, security features."},"37":{"u":".\/\/guide-en-template.html","t":"Using template engines ","d":"By default Yii uses PHP as template language, but you can configure it to support other rendering engines, such as\nTwig or Smarty."},"38":{"u":".\/\/guide-en-testing.html","t":"Testing ","d":"TDB"},"39":{"u":".\/\/guide-en-theming.html","t":"Theming ","d":"TDB"},"40":{"u":".\/\/guide-en-title.html","t":"The Definitive Guide to Yii 2.0 ","d":"This tutorial is released under the Terms of Yii Documentation."},"41":{"u":".\/\/guide-en-upgrade-from-v1.html","t":"Upgrading from Yii 1.1 ","d":"In this chapter, we list the major changes introduced in Yii 2.0 since version 1.1.\nWe hope this list will make it easier for you to upgrade from Yii 1.1 and quickly\nmaster Yii 2.0 based on your existing Yii knowledge."},"42":{"u":".\/\/guide-en-url.html","t":"URL Management ","d":"The concept of URL management in Yii fairly simple. URL management is based on the premise that the application uses internal routes and parameters\neverywhere. The framework itself will then translates routes into URLs, and translate URLs into routs, according to the URL manager's configuration.\nThis approach allows you to change site-wide URLs merely by edited a single config file, without ever touching the application code."},"43":{"u":".\/\/guide-en-validation.html","t":"Model validation reference ","d":"This guide section doesn't describe how validation works but instead describes all Yii validators and their parameters.\nIn order to learn model validation basics please refer to Model, Validation subsection."},"44":{"u":".\/\/guide-en-view.html","t":"View ","d":"View is an important part of MVC and is responsible for presenting data to end users."}};
jssearch.tokenizeString = function(string) {
		var stopWords = ["a","an","and","are","as","at","be","but","by","for","if","in","into","is","it","no","not","of","on","or","such","that","the","their","then","there","these","they","this","to","was","will","with","yii"];
		return string.split(/[\s\.,;\:\\\/\[\]\(\)\{\}]+/).map(function(val) {
			return val.toLowerCase();
		}).filter(function(val) {
			return !(val in stopWords);
		}).map(function(word) {
			return {t: word, w: 1};
		});
};